import React, { Component } from "react";

class Person extends Component {
  constructor(props) {
    super(props);
    this.props = props;
    this.state = {
      name: "John",
      age: 23,
    };
  }
  nameChangeHandler(){
    this.setState({
      name: "Anas"
    });
  }
  render() {
    return (
      <div>
        <div>
        <h1>
        My name is {this.state.name} and My age is {this.state.age}
        </h1>
        <br></br>
        <button onClick={() => this.nameChangeHandler()}></button>  
        </div>
      </div>
    );
  }
}

export default Person;
